import React from "react";
import Navbar from "./Navbar";

export default function FileHistoryLog({ user, onLogout }) {
  const logs = [
    { user: "Alice", action: "Uploaded", doc: "Plan.pdf", time: "2025-10-11 09:23" },
    { user: "Bob", action: "Edited", doc: "Budget.xlsx", time: "2025-10-10 14:05" },
  ];

  return (
    <>
      <Navbar user={user} onLogout={onLogout} />
      <div className="p-6">
        <h2 className="text-2xl font-semibold mb-4">File History / Audit Log</h2>
        <table className="min-w-full bg-white rounded-lg shadow">
          <thead>
            <tr className="bg-gray-200 text-left">
              <th className="p-3">User</th>
              <th className="p-3">Action</th>
              <th className="p-3">Document</th>
              <th className="p-3">Timestamp</th>
            </tr>
          </thead>
          <tbody>
            {logs.map((l, i) => (
              <tr key={i} className="border-t hover:bg-gray-50">
                <td className="p-3">{l.user}</td>
                <td className="p-3">{l.action}</td>
                <td className="p-3">{l.doc}</td>
                <td className="p-3">{l.time}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
}
